  false,\n\t\"url\": null,\n\t\"notes\": \"The following development prospectus for
  Kenai National Wildlife Refuge is based on the 10 Public Use Requirements established
  as a minimum for the National Wildlife Refuge and National Fish Hatchery System.
  \ These requirements include: (1) set station public use goals; (2) project a positive
  attitude; (3) welcome and orient visitors; (4) develop key resource awareness; (5)
  provide observation opportunities; (6) provide teacher assistance; (7) maintain
  a quality hunting program; (8) maintain a quality fishing program; (9) manage cultural
  resources; and (10) explore public assistance opportunities for field station operations.
  \ Suggestions for improvement in each of these ten areas are provided.\",\n\t\"owner_org\":
